import React, { useState } from 'react';
import './Hero.css';

const Hero6 = () => {
  const [showEmail, setShowEmail] = useState(false);

  const toggleEmail = () => {
    setShowEmail(!showEmail);
  };

  return (
    <section className="hero">
      <h1>Contact</h1>
      <p>
        <button onClick={toggleEmail} className="toggle-button">
          {showEmail ? 'Hide Email' : 'Show Email'}
        </button>
      </p>
      {showEmail && <p>Email: your.email@example.com</p>}
      <p>
        <a href="https://github.com/som1shi" target="_blank" rel="noopener noreferrer">
          My GitHub
        </a>
      </p>
      <p>
        <a href="https://www.linkedin.com/in/sarvagyasomvanshi" target="_blank" rel="noopener noreferrer">
          My LinkedIn
        </a>
      </p>
    </section>
  );
};

export default Hero6;
